import React from "react";
import './style.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

import Home from "./home";
import SaleForm from "../price_form/saleForm";

export default function Content(props){
    if (props.name == "home") {
        return (
            <>
                <Home/>
            </>
        );
    }else{
        return (
            <>
                <SaleForm></SaleForm>
            </>
        );
    }
}
